import './App.css';
import 'antd/dist/antd.css';
import CustomLayout from './container/layout'
import Article from './component/articls'

function App() {
  return (
    <div className="App">

      <CustomLayout>
        <Article />
      </CustomLayout>


    </div>
  );
}

export default App;
